function init() { //初回実行処理はここに
	redo=0;
	const width = 1280;
	const height = 960;


	renderer = new THREE.WebGLRenderer({
	canvas: document.querySelector('#appCanvas'),
	antialias: true,
	alpha: true
	});
	renderer.setPixelRatio(window.devicePixelRatio);
	renderer.setSize(width, height);
	// キャンバスをDOMツリーに追加
	// document.body.appendChild( renderer.domElement );

	// シーンを作成
	scene = new THREE.Scene();

	// 座標軸を表示
	// var axes = new THREE.AxisHelper(1000);
	// scene.add(axes);

	// カメラを作成
	// camera = new THREE.PerspectiveCamera(10, width / height, 1, 10000);
	camera = new THREE.OrthographicCamera(-width/2, width/2, height/2, -height/2, 1, 10000);
	camera.position.set(0, 0, +1000);
	camera.zoom = 4.5;
	camera.updateProjectionMatrix();

	// 平行光源
	scene.remove(light);
	light = new THREE.AmbientLight(0xFFFFFF);
	light.intensity = 1; // 光の強さを倍に
	light.position.set(100,100,100);
	// シーンに追加
	scene.add(light);

	//ドラッグコントロール　移動時に使用
	dragControls = null;
	dragControls = new THREE.DragControls( objects, camera, renderer.domElement );
	// ドラッグ開始
	dragControls.addEventListener( 'drag', function ( event ) {
		// 最大のzを得る
		var maxz = objects[0].position.z;
		for (var i = 0; i < objects.length; i++) {
		maxz = maxz < objects[i].position.z ? objects[i].position.z : maxz;
		}
		// zを変更
		// for (var i = 0; i < objects.length; i++) {
		//   objects[i].position.z =　0;
		// }
		event.object.position.z = maxz + 1; // 前面に
	});  	

	//トランスフォームコントロール　今回はロールのみ使用。引数ではガイド表示を消せなかったので、lib/TransformControls.jsを無理やりいじってある。
	transControl = new THREE.TransformControls( camera, renderer.domElement );
	// transControl.addEventListener( 'change', tick ); いらない。コレを入れるとtickがどんどん溜まってものすごく動作が重くなっていく
	transControl.addEventListener('dragging-changed',function(event){
		transControlStatus = !transControlStatus  //ドラッグ中は対象を変えない
	});
	transControl.setMode("rotate"); //回転モードに限定

	mode = 2;
	clickMove(); //初回は移動モードに設定

	// 初回実行
	if(reset==0){
		tick();
		reset++;
	}
	tickUpdate();
}

// 1フレーム毎に処理するものはここに
function tick() {
	// poleEdgeShow();
	handMaidRotationController();
	positionRestrictor();
	// canEdgeShow();
	requestAnimationFrame(tick);
	// レンダリング
	renderer.render(scene, camera);
	renderer.setClearColor(0xFFFFFF);
}
  
function tickUpdate(){
	// レンダリング
	renderer.render(scene, camera);
	renderer.setClearColor(0xFFFFFF);
}

