 function makeLidEdge(mesh,col){
	const lineWidth = 0.0006; 
	let edgeLine = [];
	let j = 0;

	let points = [];
	for (let i = 0; i < (mesh.geometry.vertices.length/2)-1; i++) {
		points.push(mesh.geometry.vertices[i]);
	}
	points.push(mesh.geometry.vertices[0]);

	for (let i = 0; i < points.length-1; i++) {
		let edgeMat = new MeshLineMaterial({
			color: col,
			lineWidth: lineWidth,
			opacity: 0.7
		  });
		let edgeGeo = new THREE.Geometry();
		edgeGeo.vertices.push(new THREE.Vector3(points[i].x,points[i].y,points[i].z));
        edgeGeo.vertices.push(new THREE.Vector3(points[i+1].x,points[i+1].y,points[i+1].z));
        var line = new MeshLine();
        line.setGeometry( edgeGeo );
		edgeLine[j] = new THREE.Mesh(line.geometry,edgeMat);
		mesh.add(edgeLine[j]);
		j++;
	}

	for (let i = 0; i < points.length-1; i++) {
		let edgeMat = new MeshLineMaterial({
			color: col,
			lineWidth: lineWidth,
			opacity: 0.7
		  });
		let edgeGeo = new THREE.Geometry();
		edgeGeo.vertices.push(new THREE.Vector3(points[i].x,-points[i].y,points[i].z));
        edgeGeo.vertices.push(new THREE.Vector3(points[i+1].x,-points[i+1].y,points[i+1].z));
        var line = new MeshLine();
        line.setGeometry( edgeGeo );
		edgeLine[j] = new THREE.Mesh(line.geometry,edgeMat);
		mesh.add(edgeLine[j]);
		j++;
	}


 }

