function handleMouseMove(e) { //マウス座標取得
	var myCanvas = document.getElementById( 'appCanvas' );
  
	var rect = myCanvas.getBoundingClientRect();  //キャンバスの余白やサイズを取得
  
	// スクリーン上のマウス位置を取得する
	var mouseX = e.clientX - rect.left; //ウィンドウ上のマウスのx座標から、キャンパスの左の余白を引く
	var mouseY = e.clientY - rect.top;
  
	// 取得したスクリーン座標を-1〜1に正規化する（WebGLは-1〜1で座標が表現される）
	mouseX =  (mouseX/rect.width)  * 2 - 1; //マウス座標をキャンパスの大きさで割る
	mouseY = -(mouseY/rect.height) * 2 + 1;
  
	// マウスの位置ベクトル
	mouse = new THREE.Vector2(mouseX, mouseY);
	if(mode==1&&transControlStatus==false)getRollTarget(mouse);
  
	mousePos.old = new THREE.Vector2(mouseX, mouseY);
	if (targetSolid!=0&&targetSolid) {
	  mousePos.initRot = {x:targetSolid.rotation.x , y:targetSolid.rotation.y};
	}else{
	  mousePos.initRot = {x:0 ,y:0}
	}
	mousePos.moving = true;
  
  
  }
  
  function handlePointerMove(e){
	var myCanvas = document.getElementById( 'appCanvas' );
  
	var rect = myCanvas.getBoundingClientRect();  //キャンバスの余白やサイズを取得
  
	// スクリーン上のマウス位置を取得する
	var mouseX = e.clientX - rect.left; //ウィンドウ上のマウスのx座標から、キャンパスの左の余白を引く
	var mouseY = e.clientY - rect.top;
  
	// 取得したスクリーン座標を-1〜1に正規化する（WebGLは-1〜1で座標が表現される）
	mouseX =  (mouseX/rect.width)  * 2 - 1; //マウス座標をキャンパスの大きさで割る
	mouseY = -(mouseY/rect.height) * 2 + 1;
  
	// マウスの位置ベクトル
	mousePos.new = new THREE.Vector2(mouseX, mouseY);
	mousePos.pointed = true;
  }
  
  function handleTouchMove(e){
	// タッチでのバージョン
	var touchObject = event.changedTouches[0] ;
  
	var myCanvas = document.getElementById( 'appCanvas' );
  
	var rect = myCanvas.getBoundingClientRect();  //キャンバスの余白やサイズを取得
  
	// スクリーン上のマウス位置を取得する
  touch.x = e.clientX - rect.left; //ウィンドウ上のマウスのx座標から、キャンパスの左の余白を引く
  touch.y = e.clientY - rect.top;
  
	// 取得したスクリーン座標を-1〜1に正規化する（WebGLは-1〜1で座標が表現される）
	touch.x =  (mouseX/rect.width)  * 2 - 1; //マウス座標をキャンパスの大きさで割る
	touch.y = -(mouseY/rect.height) * 2 + 1;
  
	if(mode==1&&transControlStatus==false)getRollTarget(touch);
  
  }
  
  function handlePointerUp(e){
	mousePos.moving = false;
	mousePos.pointed = false;
  }
  
  function handMaidRotationController(){
	if (mousePos.new&&mousePos.old&&mousePos.moving&&mousePos.pointed) {
	  let rotateY = (mousePos.new.x - mousePos.old.x) * 5;
	  let rotateX = (mousePos.old.y - mousePos.new.y) * 5;
	
	  if (targetSolid) {
		targetSolid.rotation.x = mousePos.initRot.x +  rotateX;
		targetSolid.rotation.y = mousePos.initRot.y +  rotateY;
	  }
  
	}
  
  
  }

  function raycasting(mover){

	// レイキャスト = マウス位置からまっすぐに伸びる光線ベクトルを生成
	raycaster.params.Points.threshold = 0.1;

	raycaster.setFromCamera( mover, camera );


	// raycaster.setFromCamera(mouse, camera);
	// raycasterTargetObjects=planeGroup;
	// その光線とぶつかったオブジェクトを得る
	var raycasterTargetObjects=[]; //交差判定を行いたいオブジェクトはここに入れる　

	   raycasterTargetObjects = solidObjects;  //レイキャストターゲットを面グループに
	   let intersects = raycaster.intersectObjects(raycasterTargetObjects); //レイキャスト実行
	   if(intersects.length > 0){  //当たり判定があれば
			let targetName = intersects[0].object.name;
			let target;
			for (let i = 0; i < solidObjects.length; i++) {
				if (solidObjects[i].name == targetName) {
					target = solidObjects[i];
				}
			}
			console.log(targetName);
			return(target);

			
		}
}

